import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/feature">
      <a style={linkStyle}>Feature</a>
    </Link>
    <Link href="/amazon">
      <a style={linkStyle}>Amazon</a>
    </Link>
    <Link href="/team">
      <a style={linkStyle}>Team</a>
    </Link>
  </div>
);

export default Header;
